<script setup lang="ts">
import { computed, defineProps, defineOptions } from '@vue/runtime-core'
defineOptions({
  name: 'SubMapZhe'
})
const props = defineProps({
  city: {
    type: String,
    default: '嘉兴'
  }
})
const cities = ['湖州', '嘉兴', '绍兴', '金华', '衢州', '丽水', '温州', '台州', '宁波', '舟山']
const getLinePath = (city_name: string | undefined) => {
  interface Pointer {
    x: number
    y: number
    city?: string
  }

  const pointers_data = [
    {
      city: '湖州',
      x: 280,
      y: 62
    },
    {
      city: '嘉兴',
      x: 373,
      y: 84
    },
    {
      city: '绍兴',
      x: 350,
      y: 194
    },
    {
      city: '金华',
      x: 222,
      y: 347
    },
    {
      city: '衢州',
      x: 113,
      y: 362
    },
    {
      city: '丽水',
      x: 260,
      y: 441
    },
    {
      city: '温州',
      x: 366,
      y: 516
    },
    {
      city: '台州',
      x: 465,
      y: 412
    },
    {
      city: '宁波',
      x: 491,
      y: 222
    },
    {
      city: '舟山',
      x: 568,
      y: 180
    }
  ]
  const start_pointer = pointers_data.find((pointer: Pointer) => pointer?.city === city_name)

  const end_pointer = {
    city: '杭州',
    x: 300,
    y: 163
  }
  const getContrlPointerPos = (start: Pointer, end: Pointer, angle: number) => {
    const { x: x1, y: y1 } = start
    const { x: x2, y: y2 } = end
    const PI = Math.PI
    // 两点之间 x 轴夹角弧度
    let xAngle = Math.atan2(y2 - y1, x2 - x1)
    // 转为角度
    xAngle = (360 * xAngle) / (2 * PI)
    // 两点间的长度
    const L = Math.sqrt((y2 - y1) ** 2 + (x2 - x1) ** 2)
    // 计算等腰三角形斜边长度
    const L2 = L / 2 / Math.cos((angle * 2 * PI) / 360)
    const x = x1 + Math.round(L2 * Math.cos(((xAngle + angle) * 2 * PI) / 360))
    const y = y1 + Math.round(L2 * Math.sin(((xAngle + angle) * 2 * PI) / 360))
    return { x, y }
  }
  const c_pointer = getContrlPointerPos(start_pointer, end_pointer, 30)
  const line_path = `
        M${start_pointer.x},${start_pointer.y}
        Q${c_pointer.x},${c_pointer.y}
        ${end_pointer.x - 10},${end_pointer.y}
      `
  return { line_path, start_pointer, end_pointer }
}
const allLinePath = computed(() => {
  const set = new Set(cities)
  return Array.from(set).map((city_name: any) => {
    console.log('city_name:', city_name)
    return getLinePath(city_name)
  })
})
// const line_path = computed(() => {
//   const {line_path} = getLinePath('温州')
